import React from "react";

const MyInfo = () => {
    return (
        <div>
            <h1>Babajide</h1>
            <p>I am the best</p>
            <ul>
                <li>1</li>
                <li>2</li>
                <li>3</li>
            </ul>
        </div>
    )
};


export default MyInfo;
